import '../../assets/css/styles.css'

const Layout=()=>{
    return (
            <>
                <div className="banaNavBar">
                    <nav className="navbar navbar-expand-lg navbar-light bg-light fixed-top py-4">
                        <Navbar />
                    </nav>
                </div>
                <main>
                    <Outlet />
                </main>
                <footer className="py-5 bg-dark">
                    <Footer/>
                </footer>
            </>
    )
}
export default Layout;
